use super::models::MultiPolygonBody;
use geo::{coord, Coord, LineString, MultiPolygon, Polygon};

pub fn make_multipolygon(entries: Vec<Vec<(f64, f64)>>) -> MultiPolygon {
    MultiPolygon::new(
        entries
            .into_iter()
            .map(|vec| {
                Polygon::new(
                    LineString::new(
                        vec.into_iter()
                            .map(|elem| coord! {x: elem.0, y: elem.1 })
                            .collect::<Vec<Coord<f64>>>(),
                    ),
                    vec![],
                )
            })
            .collect::<Vec<Polygon>>(),
    )
}

